import React from "react"
import styled from "styled-components"
import { Container } from "./contants"
import { Title } from "./contants"
const Item = styled.div``
const Name = styled.span`
  font-weight: 600;
`
const Value = styled.span``
const API = [
  {
    name: "ContactID",
    value: "ABC",
  },
  {
    name: "CustomerID",
    value: 123456,
  },
  {
    name: "Agent",
    value: 26644,
  },
  {
    name: "ContactDate",
    value: "09-Mar-21 11:48:28",
  },
  {
    name: "ContactType",
    value: "Voice",
  },
  {
    name: "CallHoldDuration",
    value: "0s",
  },
  {
    name: "CallDuration",
    value: "53s",
  },
]
const ContactDetails = () => {
  return (
    <Container>
      <Title>ContactDetails</Title>
      <Wrapper>
        {API.map((item) => (
          <Item>
            <Name>{item.name}: </Name>
            <Value>{item.value}</Value>
          </Item>
        ))}
      </Wrapper>
    </Container>
  )
}

export default ContactDetails
